import logo from './logo.svg';
import React from 'react';
import './index.css';

const JoinLastName = ({firstName = "Dare" , lastName = "Oyekunle"}) => firstName + " - " + lastName;


function JoinName() {
  return (
    <div className='container justify-center items-center grid'>
      <h1 className='text-green-700 text-3xl font-extrabold'>{JoinLastName()}</h1>
    </div>
  );
}
export default JoinName;
